long_desc.thetext:
If you have an unmanaged image (mine is a jpg) and view in IE, the image appears but also has a "broken image" image overlaid on top of it.  This happens because IE is set to use the AlphaLoader filter and the src attribute is not needed; qx.bom.element.Decoration can set src to null/undefined, but fixing this is not enough - if you simply so not set src to null/undefined you get a different "broken image" image overlaid.

The answer is to always set the src attribute to something, eg qx/static/blank.gif; change line 114 of qx.bom.element.Decoration to:

  var ret = this.getAttributes(source, repeat, style);
  if (tag === "img") {
    element.src = ret.src||qx.util.ResourceManager.
        getInstance().toUri("qx/static/blank.gif");
  }

This me took a little while to reproduce because there was a vital detail that was wrong in the previous report: (a) the image must be a PNG, not a JPG, and (b) the image must be set to scale (sorry guys).

Also, while debugging it today, I hit the exception on line 108 "Image modification not possible because elements could not be replaced at runtime anymore!"; this error is not reported and appears to be silently ignored...and the image is displayed anyway (with the broken image box).

There's still something different between the snippet below and my app because the "Image modification not possible" only happens for me in the snippet, not my app but I hope it's enough to reproduce it.  BTW, I'm loading all this via a webserver, not the local filing system.

In case it's to do with my image, I'll attach the actual PNG used in the demo.

Create a skeleton app and add:

  // Document is the application root
  var doc = this.getRoot();

  var img = new qx.ui.basic.Image("/public/explorer-demo/testpilot.png");
  img.set({ scale: true })
  doc.add(img, { left: 100, top: 100 });
